import React from 'react'

export default function Comp52() {
  useEffect(() => {
      axios
        .get("https://fakestoreapi.com/products/categories")
        .then((result) => {
          console.log(result);
        })
        .catch((error) => {
          console.log(error);
        });
    }, []);
  return (
    <div>Comp52</div>
  )
}
